ooden door.";i:54;s:69:"A high-quality finish can enhance the appearance of your garage door.";i:55;s:58:"Vivid royal blue is one of the standout front door colors.";i:56;s:118:"The deep blue color is calming and goes with most house colors but it accents the pale gray of this house very nicely.";i:57;s:104:"Royal blue is a timeless color choice that will wear well and look great with accents from many seasons.";i:58;s:62:"Hang a wreath with touches of blue for a pulled together look.";}}